import logo from './logo.svg';
import './App.css';
import UI from './components/UI';
import Info from './components/Info'
import Header from './components/Header'
function App() {
  return (
    <div className="App">
      <Header />
      <section><video src="http://phpcoder.tech/html-css/Smoke.mp4" autoplay muted></video>

      </section>
      <UI />
      <Info />
    </div>
  );
}

export default App;
